import React from "react";

function LinkRow(props) {
  return (
    <tr>
      <th scope="row">{props.id}</th>
      <td>{props.title}</td>
      <td>{props.url}</td>
      <td>
        {props.tags.map((tag, index) => {
          <li key={index}>{tag}</li>;
        })}
      </td>
    </tr>
  );
}

export default LinkRow;
